import React from 'react';
import { Link } from 'react-router-dom';
import 'Navba'

const Navbar = ({ isLoggedIn, onLogout, openModal }) => {
  return (
    <header className="navbar">
      <h1 className="logo">CPP Coding Club</h1>
      <nav>
        <ul className="nav-links">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/contests">Contests</Link></li>
          <li><Link to="/leaderboard">Leaderboard</Link></li>
          {isLoggedIn && (
            <li><Link to="/create-contest">Create Contest</Link></li>
          )}
          {isLoggedIn ? (
            <li>
              <button className="logout-btn" onClick={onLogout}>
                Logout
              </button>
            </li>
          ) : (
            <>
              <li>
                <button className="login-btn" onClick={() => openModal('login')}>
                  Login
                </button>
              </li>
              <li>
                <button className="register-btn" onClick={() => openModal('register')}>
                  Register
                </button>
              </li>
            </>
          )}
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
